-- ----------------------------
--  Table structure for `assessment_response`
-- ----------------------------
DROP TABLE IF EXISTS `assessment_response`;
CREATE TABLE `assessment_response` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `assessment_id` int(11) DEFAULT NULL,
  `question_id` int(11) NOT NULL,
  `response` varchar(500) DEFAULT NULL,
  `assessor_comments` longtext,
  `member_comments` text,
  `response_index` int(11) DEFAULT NULL,
  `recommended_resource_id` int(11) DEFAULT NULL,
  `time_stamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_evaluation_responses` (`assessment_id`,`question_id`),
  KEY `evaluation_id_index` (`assessment_id`),
  KEY `question_id_index` (`question_id`),
  KEY `assessment_response_resource__fk` (`recommended_resource_id`),
  CONSTRAINT `assessment_response_ibfk_1` FOREIGN KEY (`assessment_id`) REFERENCES `assessment` (`id`),
  CONSTRAINT `assessment_response_ibfk_2` FOREIGN KEY (`question_id`) REFERENCES `question` (`id`),
  CONSTRAINT `assessment_response_resource__fk` FOREIGN KEY (`recommended_resource_id`) REFERENCES `resource` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20345 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

