INSERT INTO `question` VALUES ('67', '12', '1', '1', '1', 'Regulation Compliance', 'Complies with federal, local, and company health and safety regulations.', null, '1'), ('68', '12', '1', '2', '2', 'Guideline Knowledge', 'Demonstrates knowledge of facility guidelines to ensure physical safety of customers and employees, including emergency shutdown procedures.', null, '1'), ('69', '12', '1', '3', '3', 'Safety Procedures', 'Be aware of evacuation routes, fire extinguisher location and use, shut-down procedures and safety manuals.', null, '1'), ('70', '12', '1', '4', '4', 'Information Dissemination', 'Disseminates information to customers addressing potential safety hazards and security issues, e.g., display safety and security information and materials in a public area.', null, '1'), ('71', '12', '1', '5', '5', 'Area Knowledge', 'Recommend stourist attractions and accommodations that will be safe for all family members.', null, '1'), ('72', '12', '1', '6', '6', 'Prevention Safeguards', 'Identifies activities that are suspicious and implement loss prevention safeguards.', null, '1'), ('73', '13', '1', '7', '1', 'Reservations', 'Employs effective reservation procedures to meet guest needs and maximize occupancy.\n Understands the different types of reservations used to meet different guest needs, e.g., guaranteed vs. non-guaranteed, reservations guaranteed by credit card vs. reservations guaranteed by travel agents or corporations.\n Familiar with common sources used to make lodging reservations.\n Experience with computer systems in processing reservations.\n Understands forecasting to maximize occupancy levels.', null, '1'), ('74', '13', '1', '8', '2', 'Check-out Procedure', 'Understands the importance of check-out procedures to ensure guest satisfaction and verify settlement of account.', null, '1'), ('75', '13', '1', '9', '3', 'Account Settlement', 'Understands and follows account settlement procedures for different types of payment.', null, '1'), ('76', '13', '1', '10', '4', 'Telephone System Skills', 'Understands basic telephone courtesy and language for answering and closing calls, placing callers on hold, transferring calls, and taking messages.', null, '1'), ('77', '14', '1', '11', '1', 'Customer Assistance', 'Understands and follows facility guidelines related to ensuring customer satisfaction by assisting customers including, luggage and item delivery, room maintenance, basic customer inquiries, etc.', null, '1'), ('78', '14', '1', '12', '2', 'Special Requests', 'Demonstrates ability to handle individual customer requests.', null, '1'), ('79', '14', '1', '13', '3', 'Complaint Handling', 'Demonstrates ability to handle customer complaints.', null, '1'), ('80', '14', '1', '14', '4', 'Customer Assistance', 'Ensure requests and complaints are dealt with promptly and to the satisfaction of the customer.', null, '1'), ('81', '15', '3', '1', '1', 'Work Schedule Management', 'Anticipates and ensures full, but optimal coverage of room attendant needs.', null, '1'), ('82', '15', '3', '2', '2', 'Follows Housekeeping Procedures', 'Follows and disseminates hotel procedures to staff.', null, '1'), ('83', '15', '3', '3', '3', 'Follows Safety Procedures', 'Trains staff regularly on evacuation routes, fire extinguisher location and use, shut-down procedures and safety manuals.', null, '1'), ('84', '15', '3', '4', '4', 'Performs Regular Progress Reviews', 'Ensures that regular performance reviews are conducted for every staff member.', null, '1'), ('85', '16', '3', '5', '1', 'Procedures', 'Establishes and updates procedures for the linen service.', null, '1'), ('86', '16', '3', '8', '2', 'Resource Management', 'Sees to it that staff have all required resources to carry out their work effectively.', null, '1'), ('87', '16', '3', '6', '3', 'Common Area Management', 'Performs regular maintenance and inspections of common areas shared by guests, ensuring that all linens are clean.', null, '1'), ('88', '16', '3', '7', '4', 'Restaurant Support', 'Works collaboratively with restaurants to ensure laundry is cleaned and delivered in a timely manner.', null, '1'), ('89', '17', '3', '8', '1', 'Customer Assistance', 'Assists customers with special cleaning requests, as needed.', null, '1'), ('90', '17', '3', '9', '2', 'Complaint Resolution', 'Follows up on complaints received directly from guests or indirectly through management.', null, '1'), ('91', '17', '3', '10', '3', 'Creativity', 'Offers creative suggestions for making guests feel they are important to our business.', null, '1');
COMMIT;

