INSERT INTO `resource` VALUES ('1', 'T', 'PM', 'PHT001', 'Introduction to the Pharmacy, for Technicians', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('2', 'T', 'PM', 'PHT002', 'Allergy Identification', null, 'Important characteristics of current and evolving advanced technician practice models\n            include training through an ASHP accredited training program, PTCB certification, and licensure with a Board of Pharmacy.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('3', 'T', 'PM', 'PHT003', 'Assessing Patients', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('4', 'T', 'PM', 'PHT004', 'Adherence Assessment', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('5', 'T', 'PM', 'PHT005', 'Prescription Labeling', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('6', 'T', 'PM', 'PHT006', 'Code of Conduct', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('7', 'T', 'PM', 'PHT007', 'Drug Interactions', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('8', 'T', 'PM', 'PHT008', 'Preventive Care', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('9', 'T', 'PM', 'PHT009', 'Calculations', null, 'Pharmacy Calculations: An Introduction for Pharmacy Technicians, is designed for pharmacy technician students enrolled in a training program, technicians preparing for the certification exam, and for on-site training. As the role for pharmacy technicians continues to evolve and expand one thing remains constant. The safety of patients is the highest priority for anyone working in pharmacy, whether in hospital, retail, or institutional practices. With a thorough understanding of pharmacy math comes accuracy in computations and safety and quality in practice.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('10', 'T', 'PM', 'PHT010', 'Preventing Errors with Look-Alike and Sound-Alike Drug Names', null, 'Drug names can often sound similar or appear similar. In addition the appearance of the products can look similar enough to cause confusion. These can easily be confused contributing to adverse medication events.', null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('11', 'T', 'PM', 'PHT011', 'Confusion Pairs and Confusion Categories', null, null, null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38'), ('12', 'T', 'PM', 'PHT012', 'High Risk High Alert Medication Review (Case Studies)', null, null, null, null, '2015-10-26 15:53:38', '2015-10-26 15:53:38');
COMMIT;

